import { inMemoryToken } from "../Components/AuthContext";
import jwt from "jsonwebtoken"

function decodeJwtToken(){
    return jwt.decode(inMemoryToken)
}



function getDate(str){
    console.log(str)
}

export {decodeJwtToken}
